export default function Vehicles() {
    function getSWAPI() {
        const requestOptions = {
            method: 'GET',
            headers: {
              'Content-Type': 'application/json',
            }
        };

        const URL = 'https://swapi.dev/api/vehicles'
        const DATA = fetch(URL, requestOptions)
                                .then(res => res.json())
        return DATA
    }

    const vehicles = getSWAPI()

    console.log(vehicles)
    return (
        <div>
            Hello world
        </div>
    )
}
